    false,nt"url": null,nt"notes": "This narrative report for Aleutian Islands
    and Izembek NWRs outlines Refuge accomplishments from May through August of 1962.
    The report begins by summarizing the weather conditions, habitat conditions, water
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, raptors, and fish- is also covered.
    The Refuge development and maintenance section discusses physical developments,
    plantings, and wildfires. Resource management is outlined; topics include grazing.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, hunting, violations, and safety. Items of interest and N-R
    forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
